import styled from 'styled-components';

export const Landingsection = styled.div`
 marign:0;
 padding:0;
 height:710px;
 width:100%;
 background:#162082;
 position:relative;
`;

export const Image = styled.img`
position:absolute;
height:800px;
width:700px;
top:-50px;
left:0;
`;

export const Image2 = styled.img`
position:absolute;
height:950px;
width:120px;
bottom:0;
right:0;
`;


export const Landingheader = styled.div`
display:grid;
background:white;
row-template-columns:repeat(1fr,3);


`;
